import{_ as e,o as a,c as t,f as n}from"./app.2c8ebc7a.js";const o="/MicroCityNotes/assets/main_window.9123f68c.png",r={},i=n('<h1 id="_3-1-user-interfaces-overview" tabindex="-1"><a class="header-anchor" href="#_3-1-user-interfaces-overview" aria-hidden="true">#</a> 3.1 User Interfaces Overview</h1><p>MicroCity provides a concise graphic windowed interface to facilitate the manipulation of data and modules.</p><h2 id="the-main-window-and-components" tabindex="-1"><a class="header-anchor" href="#the-main-window-and-components" aria-hidden="true">#</a> The Main Window and Components</h2><p><img src="'+o+'" alt="Screenshot"></p><h2 id="supported-files" tabindex="-1"><a class="header-anchor" href="#supported-files" aria-hidden="true">#</a> Supported Files</h2><p>MicroCity can open ArcGIS shapefile (*.shp), Grids file (*.sgrd), dBase file (*.dbf), Tabular text file (*.csv, *.txt), Point clouds (*.spc), Image file (*.bmp, *.gif, *.jpg, *.png, *.tif, *.pcx) and MicroCity 3D Scene (*.m3d). These data files are maintained in the <strong>Data</strong> Tab of the <strong>Workspace</strong> Panel. Module libraries (*.dll, *.mcs) are maintained and executed through the <strong>Modules</strong> Tab of the <strong>Workspace</strong> Panel.</p><h2 id="project-management" tabindex="-1"><a class="header-anchor" href="#project-management" aria-hidden="true">#</a> Project Management</h2><p>The information of opened data files, module libraries, settings and sub-windows can be saved or opened in a <strong>MicroCity Project (*.mprj)</strong> through the menu <strong>File-&gt;Project</strong>. The mprj file does not contain any <strong>file&#39;s data</strong>. For easy maintenance, files in a project should be put into the same folder or sub-folders of the mprj file.</p>',8),s=[i];function d(c,h){return a(),t("div",null,s)}const p=e(r,[["render",d],["__file","3.1_ui_overview.html.vue"]]);export{p as default};
